// SPDX-License-Identifier: MIT
pragma solidity ^0.6.12;

// remix test SC
// dpeloyed to the Kovan network
import "@chainlink/contracts/src/v0.6/interfaces/AggregatorV3Interface.sol";

contract OracleEUR_USD {
    // priceFeed AggregatorV3Interface EUR/USD
    AggregatorV3Interface internal priceFeed;

    constructor() public {
        priceFeed = AggregatorV3Interface(
            0x0c15Ab9A0DB086e062194c273CC79f41597Bbf13
        ); // EUR/USD ON Kovan
    }

    // Returns the latest EUR USD price
    function getLatestPrice() public view returns (int256) {
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        // If the round is not complete yet, timestamp is 0
        require(timeStamp > 0, "Round not complete");
        return price; // this would cut all decimals!
    }
}
